import {Copyright} from "@material-ui/icons";



function Footer() {
    const classes = useStyles()
    const [isAuthenticated, setIsAuthenticated] = useState(true);
    this.state = {
        phrases: [
            {
                author: 'Руми',
                text: "Продай разум и купи изумление, так как проницательность ума является мыслью, а изумление — истинным видением.",
            },
            {
                author: 'Руми',
                text: "Продай разум и купи изумление, так как проницательность ума является мыслью, а изумление — истинным видением.",
            },
            {
                author: 'Руми',
                text: "Продай разум и купи изумление, так как проницательность ума является мыслью, а изумление — истинным видением.",
            },
            {
                author: 'Руми',
                text: "Продай разум и купи изумление, так как проницательность ума является мыслью, а изумление — истинным видением.",
